(19, 98, 'Sports', 'sports', '<p><img src=\"images/Gallery/image1.png\" alt=\"\" />Students are allowed to participate in sports in order to improve their body health, skills and also break the class monotony.</p>', '', 1, 2, '2019-06-02 17:28:21', 674, '', '2019-06-02 17:28:21', 0, 674, '2019-06-02 17:35:00', '2019-06-02 17:28:21', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(20, 99, 'Departments', 'departments', '<p style=\"text-align: center;\"><strong>Idara ya KIswahili</strong></p>\r\n<p> </p>\r\n<div id=\"webs-bin-56b0e96147d10642560454a9\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-text \">\r\n<div class=\"webs-text \">\r\n<p>Idara hii ina walimu # mahiri wanaofanya kazi kwa ushirikiano mkubwa  na bidii za mchwa. Walimu wenyewe ni wafuatao;</p>\r\n<p> </p>\r\n<ol class=\"style-decimal\">\r\n<li>Bw. #</li>\r\n<li>Bw. #</li>\r\n<li>Bw. #</li>\r\n<li>Bi. #</li>\r\n<li>Bw. #</li>\r\n</ol>\r\n<p>Maono ya idara hii ni kuwawezesha wanafunzi kuimudu , kuienzi na kuiendeleza lugha tukufu ya Kiswahili. Hii imekuwa msukumo mkubwa kwa walimu katika idara hii kujitoa mhanga ili kufanikisha maono hayo</p>\r\n<p>Ufundishaji wa somo hutekelezwa na kwa kutegemea mkondo wa wima ambapo kila mwalimu ana darasa kuanzia kidato cha kwanza hadi kidato cha nne. Utaratibu huu humwezesha kila mwalimu kuwa na tajriba katika vidato vyote vya madarasa.</p>\r\n<p>Kutokana na juhudi kubwa za idara kwa jumla na shule nzima ,Mikakati mingi imebuniwa ili kuboresha lugha hii. Kwa mfano;</p>\r\n<ol class=\"style-decimal\">\r\n<li>Mitihani ya kila mara kwa wanafunzi.</li>\r\n<li>Wanafunzi kushiriki makongamano na shule zingine jirani</li>\r\n<li>Siku ya ijumaa kutambuliwa rasmi kama siku ya kuwasiliana kwa lugha ya Kiswahili.</li>\r\n<li>Vitabu vya kila nia vimenunuliwa na kuwekwa maktabani.</li>\r\n</ol>\r\n<p> </p>\r\n<p>Kutokana na mikakati hiyo, somo la Kiswahili limetia fora na matokeo na matokeo ya mitihani ya kitaifa yamekuwa ya kuridhisha na yamekuwa yakiimarika kila mwaka. Kwa mfano katika mwaka uliopita(2011), somo hili lilikuwa na alama ya wastani ya 9.98; alama ambayo haijawahi kufikiwa hapa shuleni. Hii iliwezekana kutokana na juhudu nyingi zilizofanywa na walimu pamoja na wanafunzi.</p>\r\n<div id=\"webs-bin-56afb27047d1064256042371\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-title  w-title-default\">\r\n<div class=\"w-text \" style=\"text-align: center;\"><span style=\"font-size: 24px;\"><span class=\"wz-bold\" style=\"font-size: 24px;\">English Department.</span><br style=\"font-size: 24px;\" /></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"webs-bin-56afb09447d1064256042319\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-text \">\r\n<div class=\"webs-text \">\r\n<p><span class=\"wz-bold\"> This department comprises # able ladies and # gentlemen. <br /></span></p>\r\n<ol class=\"style-decimal\">\r\n<li><span class=\"wz-bold\">Mr. #</span></li>\r\n<li><span class=\"wz-bold\">Mr. #<br /></span></li>\r\n<li><span class=\"wz-bold\">Mr. #</span></li>\r\n<li><span class=\"wz-bold\"> Mr. #</span></li>\r\n<li><span class=\"wz-bold\">Md. #</span></li>\r\n</ol>\r\n<p><span class=\"wz-bold\">  We, as a department, are aplomb to say that this has been achieved through unity of purpose, selflessness and iron determination by the departmental members. I affirm that, without dread of contradiction, that the teachers in the department are utterly industrious, proactive and committed absolutely to the preferment of English language. This is possible because we have put in place watertight measures and mechanisms that will surely enable us realize our dream target mean score. Below are tabulated results of English of the 2011 K.C.S.E, a testimony to the continued upswing improvement; a clear indicator that the 2015 projected mean score is feasible.</span></p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span class=\"wz-bold\">     The students, on their part, are working around the clock to ensure that they garner sterling results that will make Mutukanio\'s name resound beyond its bounds. They have exhibited insatiable rest for studying that will surely see them soaring to greater heights in performance. </span></p>\r\n<div id=\"webs-bin-56b0ecf147d1064256045593\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-title  w-title-default\">\r\n<div class=\"w-text \" style=\"text-align: center;\"><span style=\"font-size: 12pt;\"><strong>Science Department</strong></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"webs-bin-56b0e9a247d10642560454c4\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-text \">\r\n<div class=\"webs-text w-font-philosopher\"><br />\r\n<p><span class=\"wz-bold\">This department is composed of the following sub- departments; physics, chemistry, and biology. Each sub-department is headed by the head of subject. Generally, the science department is headed by #<br /></span></p>\r\n<p><span class=\"wz-bold\">This department is comprised of the following members of staff;</span></p>\r\n<ol class=\"style-decimal\">\r\n<li><span class=\"wz-bold\">Mr. #</span><span class=\"wz-bold\"><br /></span></li>\r\n<li><span class=\"wz-bold\">Mr. #<br /></span></li>\r\n<li><span class=\"wz-bold\"> Mr. #<br /></span></li>\r\n<li><span class=\"wz-bold\"> Mr. #</span></li>\r\n<li><span class=\"wz-bold\">Mrs. #</span></li>\r\n</ol>\r\n<p><span class=\"wz-bold\">Chemistry is one of the compulsory subjects in our school. The sub- department is one of the most crucial in the science department. In the department, we have a dedicated and focused team of teachers and laboratory staff who work around the clock to ensure that the students attain their best in subject.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"webs-bin-56b0ea0c47d10642560454f2\" class=\"webs-bin\"> </div>\r\n<div id=\"webs-bin-56b0ee2147d10642560455c9\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-title  w-title-default\">\r\n<div class=\"w-text \" style=\"text-align: center;\"><span class=\"wz-bold\"><span style=\"font-size: 14pt;\"><strong>Humanities Department</strong></span><br /></span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"webs-bin-56b0ec0647d1064256045559\" class=\"webs-bin\">\r\n<div class=\"webs-bin-wrap\">\r\n<div class=\"webs-container webs-module-text \">\r\n<div class=\"webs-text \">\r\n<p><span class=\"wz-bold\">The department comprises the following;</span></p>\r\n<ol class=\"style-decimal\">\r\n<li><span class=\"wz-bold\">Geography</span></li>\r\n<li><span class=\"wz-bold\">History</span></li>\r\n<li><span class=\"wz-bold\">Christian Religious Education.</span></li>\r\n</ol>\r\n<p><span class=\"wz-bold\"> The department has a total of <span style=\"color: #b30225;\">#</span> teachers, i.e;</span></p>\r\n<ol class=\"style-decimal\">\r\n<li><span class=\"wz-bold\">Mrs. #<br /></span></li>\r\n<li><span class=\"wz-bold\">Mr.#</span></li>\r\n<li><span class=\"wz-bold\">Mr.#</span></li>\r\n<li><span class=\"wz-bold\">Mr.#</span></li>\r\n</ol>\r\n<p><span class=\"wz-bold\">The performance has been pleasing with a promising upward trend. For instance, the 2018 K.C.S.E Exam mean score was *** and we are hoping to achieve at least a mean score of 11.00 in the anticipated coming K.C.S.E Examination.</span></p>\r\n<p><span class=\"wz-bold\"> </span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 2, '2019-06-11 09:52:59', 674, '', '2019-06-11 09:52:59', 0, 0, '0000-00-00 00:00:00', '2019-06-11 09:52:59', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', '');

