(99, 76, 'DJ-ImageSlider', '', '', 1, 'showcase', 0, '0000-00-00 00:00:00', '2019-05-27 05:26:07', '0000-00-00 00:00:00', 1, 'mod_djimageslider', 1, 0, '{\"slider_source\":\"0\",\"slider_type\":\"2\",\"theme\":\"default\",\"link_image\":\"1\",\"image_folder\":\"images\\/me\",\"link\":\"\",\"show_title\":\"1\",\"show_desc\":\"1\",\"show_readmore\":\"0\",\"readmore_text\":\"\",\"link_title\":\"1\",\"link_desc\":\"0\",\"limit_desc\":\"\",\"full_width\":\"0\",\"image_width\":\"1500\",\"image_height\":\"1000\",\"fit_to\":\"1\",\"image_centering\":\"0\",\"visible_images\":\"3\",\"space_between_images\":\"10\",\"max_images\":\"20\",\"sort_by\":\"1\",\"css3\":\"1\",\"autoplay\":\"1\",\"looponce\":\"0\",\"show_buttons\":\"0\",\"show_arrows\":\"1\",\"show_custom_nav\":\"2\",\"wcag\":\"1\",\"desc_width\":\"\",\"desc_bottom\":\"0\",\"desc_horizontal\":\"0\",\"left_arrow\":\"\",\"right_arrow\":\"\",\"play_button\":\"\",\"pause_button\":\"\",\"arrows_top\":\"40\",\"arrows_horizontal\":\"10\",\"idx_style\":\"0\",\"effect\":\"Expo\",\"effect_type\":\"0\",\"duration\":\"2500\",\"delay\":\"200\",\"preload\":\"800\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(100, 84, 'Our mission and vision', '', '<p style=\"text-align: justify;\"><span style=\"font-family: times new roman, times, serif; font-size: 12pt;\">Our <a href=\"index.php/about-us/mission-and-vision\">Mission</a> is to achieve the best and improve the students dreams about their future.<a href=\"index.php/about-us/mission-and-vision\">Vision</a> is promoting innovation and promoting the leadership of students</span></p>', 1, 'top-1b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(101, 85, 'Admission', '', '<p style=\"text-align: justify;\"><span style=\"font-family: times new roman, times, serif; font-size: 12pt;\">Since back in 1994 almost all primary school pupils have been making our school as one ot their choice and therefore the boards has to sit down and select the required amount as per the school size and available resources and also based on their K.C.P.E results. We always admit students from all over the country.<br /></span></p>', 1, 'top-1c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(102, 86, 'B.O.M', '', '<p>Led by their chairman, these are the fellows who work hand in hand with the school to ensure the normal running of our school. They ensure that the school have got enough requirements in terms of resources and also are involved in the implementation of the school budget...<a href=\"index.php/about-us/management-board\">Learn more</a></p>', 1, 'top-1d', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(103, 87, 'The Principle', '', '<p><img style=\"float: left; border-radius: 50%; -moz-border-radius: 50%; -webkit-border-radius: 50%; -0-border-radius: 50%;\" src=\"images/princii.png\" alt=\"\" width=\"100\" height=\"100\" /><span style=\"font-family: times new roman, times, serif; font-size: 12pt;\">\'\'Together with the management board we are working at ensuring that the students are provided with their rights of being educated and also i ensure that the school is able to provide pleasing results both to the nation and back to their societies\'\'</span></p>', 1, 'top-1a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(104, 92, 'Follow-Us-On', '', '', 1, 'top-2b', 0, '0000-00-00 00:00:00', '2019-05-27 07:51:08', '0000-00-00 00:00:00', 1, 'mod_je_social', 1, 1, '{\"iconStyle\":\"0\",\"Icon1\":\"#\",\"Icon2\":\"#\",\"Icon3\":\"#\",\"Icon4\":\"#\",\"Icon5\":\"\",\"Icon6\":\"\",\"Icon7\":\"\",\"Icon8\":\"#\",\"Icon9\":\"\",\"Icon10\":\"\",\"Icon11\":\"\",\"Icon12\":\"\",\"Icon13\":\"\",\"Icon14\":\"\",\"Icon15\":\"\",\"Icon16\":\"\",\"Icon17\":\"\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(105, 93, 'Testimonials', '', '<p style=\"text-align: left;\"><span style=\"font-family: times new roman, times, serif; font-size: 12pt;\">\"All what matters is the hard work of each student\"</span><br /><span style=\"font-family: times new roman, times, serif; font-size: 12pt;\">                              ...Principal</span></p>\r\n<p style=\"text-align: left;\"> </p>', 1, 'top-2b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(106, 94, 'Sports', '', '<p style=\"text-align: left;\"><img src=\"images/sport.png\" alt=\"\" />Students are allowed to participate in sports in order to improve their body health, skills and also break the class monotony.</p>', 1, 'top-2b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(107, 95, 'Footer', '', '', 1, 'footer-1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_footer', 1, 0, '{\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(108, 96, 'Gallery', '', '', 1, 'top-2c', 0, '0000-00-00 00:00:00', '2019-05-28 07:42:21', '0000-00-00 00:00:00', 1, 'mod_j51thumbsgallery', 1, 1, '{\"path\":\"\\/images\\/Gallery\",\"thumbwidth\":\"80\",\"thumbheight\":\"80\",\"margin\":\"4\",\"bordersize\":\"4\",\"bordercolor\":\"#f0f0f0\",\"outlinecolor\":\"#f0f0f0\",\"fade_opacity\":\"0.3\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(109, 97, 'Chairman', '', '<p><img style=\"float: left; width: 10%; height: 10%; border-radius: 50%; -moz-border-radius: 50%; -webkit-border-radius: 50%; -0-border-radius: 50%;\" src=\"images/image7.png\" alt=\"\" />The chairman of the school addressing both the students and their parents. He emphasizes mostly on the students affairs more so on various ways of improving their performance for the purpose of them being among the Kenyan leaders in various fields.</p>', 1, 'top-2a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
